Kenai droomt over een meisje, Nita, dat hij vroeger heeft leren kennen. Ze waren de beste vrienden, maar ze verdween op een gegeven moment uit zijn leven. Toevallig komt hij Nita de volgende dag tegen, alhoewel toevallig: Nita moet de ketting die ze vroeger van Kenai heeft gekregen samen met Kenai verbranden op de plek waar ze hem gekregen heeft, om zo de band tussen hun te verbreken zodat ze kan trouwen met haar verloofde. Maar is dat wel wat ze wil?:
